angular.module("mundialMath.resources",[]).factory("mundialApi",["$http",function(r){var t="http://127.0.0.1:5000";return{getUsers:function(){return r({url:t+"/users/score",method:"GET",withCredentials:!1,crossDomain:!0,eventHandlers:{}})},getInputs:function(e){return r({url:t+"/users/"+e,method:"GET",withCredentials:!1,crossDomain:!0,eventHandlers:{}})},getInputsWizard:function(e){return r({url:t+"/wizard/"+e,method:"GET",withCredentials:!1,crossDomain:!0,eventHandlers:{}})},getPartidos:function(){return r({url:t+"/partidos",method:"GET",withCredentials:!1,crossDomain:!0,eventHandlers:{}})},enviarOdds:function(e){r({url:t+"/users/"+e.usuario,method:"POST",params:e,crossDomain:!0})},actualizarPartido:function(e){r({url:t+"/partidos",method:"POST",params:e,crossDomain:!0})}}}]);